import React from 'react';
import model from '../../images/model.jpg';
import './TeamLanding.css'; 

function TeamLanding() {

    const members = [
        {
            memberImage: model,
            name: "Yunus Kocaman",
            description: "Software Engineer",
        },
        {
            memberImage: model,
            name: "Danish Abbasi",
            description: "Software Engineer"
        },
        {
            memberImage: model,
            name: "Joseph Sosa",
            description: "Software Engineer"
        },
        {
            memberImage: model,
            name: "FitzGerald Wangaru",
            description: "Software Engineer"
        }
    ]
    return (
        <div className="Our__team">
                <div className="header" style={{ borderBottom: "3px solid black", width: "100%" }}>
                    <div className="title" style={{ display: "flex", justifyContent: "center" }}>
                        <h1>Meet The Team</h1>
                    </div>
                </div>
            <div className="container">
                <div className="team__wrapper">
                    {
                        members.map((item, index) => (
                            <div className='team__item' key={index}>
                                <div className='team__img'>
                                    <img src={item.memberImage} alt='Member' />
                                </div>
                                <div className='team__details'>
                                    <h4>{item.name}</h4>
                                    <p className='description'>{item.description}</p>
                                </div>
                            </div>
                        ))
                    }
                </div>
            </div>
        </div>
    );
}

export default TeamLanding;
